function get_item(obj, key) {
	console.log(obj)
	return <h1 key={key}>obj["full-name"]</h1>
}

function Team(props) {
	const  slideCards = [
		{
			'full-name': "Алеша попович"
		},
		{	
			'full-name': "Никита Васин"
		},
		{
			'full-name': "Алексей Васькин"
		}
	]

	const sliderConfigs = {
		slidesToShow: 3,
    	slidesToScroll: 1,
    	infinite: false,
	}
	console.log(...sliderConfigs)
	return <Slider {...sliderConfigs}>
			slideCards.map(get_item)
		</Slider>
		

}

export default Team
